describe('Table autoFit validation', () => {
    let editor: DocumentEditor = undefined;
    beforeAll(() => {
        let ele: HTMLElement = createElement('div', { id: 'container' });
        document.body.appendChild(ele);
        editor = new DocumentEditor({ enableEditor: true, isReadOnly: false });
        DocumentEditor.Inject(Editor, Selection, EditorHistory);
        editor.enableEditorHistory = true;
        (editor.documentHelper as any).containerCanvasIn = TestHelper.containerCanvas;
        (editor.documentHelper as any).selectionCanvasIn = TestHelper.selectionCanvas;
        (editor.documentHelper.render as any).pageCanvasIn = TestHelper.pageCanvas;
        (editor.documentHelper.render as any).selectionCanvasIn = TestHelper.pageSelectionCanvas;
        editor.appendTo('#container');
        editor.open(JSON.stringify(sfdt));
    });
    afterAll((done) => {
        editor.destroy();
        document.body.removeChild(document.getElementById('container'));
        editor = undefined;
        document.body.innerHTML = '';
        setTimeout(function () {
            done();
        }, 500);
    });

    it('check preferedWidth Type', () => {
        console.log('check preferedWidth Type');
        let tableWidget: TableWidget = editor.documentHelper.pages[0].bodyWidgets[0].childWidgets[0] as TableWidget;
        expect(tableWidget.tableFormat.preferredWidthType).toBe('Percent');
    });

    it('check auto fit', function () {
        console.log('check auto fit');
        var tableWidget = editor.documentHelper.pages[0].bodyWidgets[0].childWidgets[0] as TableWidget;
        expect(tableWidget.tableFormat.allowAutoFit).toBe(true);
    });
    it('Atleast height type table rendering', () => {
        console.log('Atleast height type table rendering');
        editor.open(JSON.stringify(sfdt1));
        expect(editor.documentHelper.pages.length).toBe(8);
    })
});

describe('Cell Vertical alignment', () => {
    let editor: DocumentEditor = undefined;
    beforeAll(() => {
        let ele: HTMLElement = createElement('div', { id: 'container' });
        document.body.appendChild(ele);
        editor = new DocumentEditor({ enableEditor: true, isReadOnly: false });
        DocumentEditor.Inject(Editor, Selection, EditorHistory);
        editor.enableEditorHistory = true;
        (editor.documentHelper as any).containerCanvasIn = TestHelper.containerCanvas;
        (editor.documentHelper as any).selectionCanvasIn = TestHelper.selectionCanvas;
        (editor.documentHelper.render as any).pageCanvasIn = TestHelper.pageCanvas;
        (editor.documentHelper.render as any).selectionCanvasIn = TestHelper.pageSelectionCanvas;
        editor.appendTo('#container');
    });
    afterAll((done) => {
        editor.destroy();
        document.body.removeChild(document.getElementById('container'));
        editor = undefined;
        document.body.innerHTML = '';
        setTimeout(function () {
            done();
        }, 500);
    });
    it('Bottom alignement', () => {
        console.log('Bottom alignement');
        editor.selection.goToHeader();
        editor.editorModule.insertTable(1, 2);
        editor.editorModule.insertText("Hello world!");
        editor.editorModule.onEnter();
        editor.editorModule.insertText("Hello world!");
        editor.editorModule.onEnter();
        editor.editorModule.insertText("Hello world!");
        editor.editorModule.onEnter();
        editor.editorModule.insertText("Hello world!");
        editor.editorModule.onEnter();
        editor.selection.handleTabKey(true, false);
        editor.editorModule.insertText("Hello world!");
        editor.selection.cellFormat.verticalAlignment = 'Bottom';
        expect(Math.round(editor.selection.start.paragraph.y)).toBe(Math.round(((editor.selection.start.paragraph.associatedCell.y + editor.selection.start.paragraph.associatedCell.height) - editor.selection.start.paragraph.height)));
        editor.selection.cellFormat.verticalAlignment = 'Top';
        expect(Math.round(editor.selection.start.paragraph.y)).toBe(Math.round((editor.selection.start.paragraph.associatedCell.y)));
        editor.selection.cellFormat.verticalAlignment = 'Bottom';
        expect(Math.round(editor.selection.start.paragraph.y)).toBe(Math.round(((editor.selection.start.paragraph.associatedCell.y + editor.selection.start.paragraph.associatedCell.height) - editor.selection.start.paragraph.height)));
    });
});
